import React from "react";
import Navbar from "../navbar/navbar";
import Functions from "../function/function";
import Info from "../info/Information";
import BackToTop from "./TotopButton";


function Home() {

    return (
        <div className="Home">

            <Navbar />
            <Functions />
            <BackToTop />
            <Info />
        </div>
    );
}

export default Home;
